function Login() {
    return (
        <div className="login-page">
            <h1 className="login-page__title">Вход</h1>
            <form className="form__login">
                <input className="form__login-input form__login-input_email"></input>
                <input className="form__login-input form__login-input_password"></input>
                <button className="form__login-button">Войти</button>
            </form>
        </div>
    )
}

export default Login;
